import React, { useEffect, useState } from 'react'
import axios from 'axios';

const Index = () => {

    // const [users, setUsers] = useState([]);



    // const getUsers = async () => {
    //     const response = await fetch("https://eb85-182-79-4-248.ngrok-free.app/");
    //     const FinalData = await response.json();
    //     setUsers(FinalData)
    // }



    // useEffect(() => {
    //     getUsers();
    // }, [])
    axios.get('https://eb85-182-79-4-248.ngrok-free.app')
        .then(response => {
            // Assuming the response is a JSON array
            const jsonArray = response.data;

            // Iterate through each item
            jsonArray.forEach(item => {
                // Do something with each item
                console.log(item);
            });
        })
        .catch(error => {
            console.error('Error fetching data:', error);
        });

    let i = 0;
    return (

        <div className="container">

            {
                jsonArray.forEach(item => {
                    i += 1;
                    return (

                        <div class="flip-card-container" >
                            <div class="flip-card">

                                <div class="card-front">
                                    <figure>
                                        <div class="img-bg"></div>
                                        <img src={"https://source.unsplash.com/random/900*700/?night&" + i} alt="Image 2" />
                                        <figcaption>{curElem.title}</figcaption>
                                    </figure>

                                    <ul>
                                        <li><div className="heading">Project Technologies</div><div className='ans'>{curElem.tech}</div></li>
                                        <li><div className="heading">Technical_Skillset.Frontend</div> <div className='ans'>{curElem.frontend}</div></li>
                                        <li><div className="heading">Technical_Skillset.Backend</div> <div className='ans'>{curElem.backend}</div></li>
                                        <li><div className="heading">Technical_Skillset.Database</div> <div className='ans'>{curElem.db}</div></li>
                                        <li><div className="heading">Technical_Skillset.Infrastructure</div> <div className='ans'>{curElem.infra}</div></li>
                                    </ul>
                                </div>

                                <div class="card-back">
                                    <figure>
                                        <div class="img-bg"></div>
                                        <img src={"https://source.unsplash.com/random/900*700/?night&" + i} alt="Brohm Lake" />
                                    </figure>

                                    <button>Book</button>

                                    <div class="design-container">
                                        <span class="design design--1"></span>
                                        <span class="design design--2"></span>
                                        <span class="design design--3"></span>
                                        <span class="design design--4"></span>
                                        <span class="design design--5"></span>
                                        <span class="design design--6"></span>
                                        <span class="design design--7"></span>
                                        <span class="design design--8"></span>
                                    </div>
                                </div>

                            </div>
                        </div>
                    );
                })
            }

        </div>



    );
}
export default Index;
